import { university } from 'fontawesome'
import './NestedMapping.css'



const Users=[
  {
      name:"mh akash",
      university : "Atish Depankar University Of Science And Technology",
      studentInfo :[
        {id:"182-0065-201"},{section:"section-2"}
        ]
  },
  {
      name:"ria",
      university : "Atish Depankar University Of Science And Technology",
      studentInfo :[
        {id:"182-0065-201"},{section:"section-2"}
     ]
  },
  {
      name:"kamal",
      university : "Atish Depankar University Of Science And Technology",
      studentInfo :[
          {id:"182-0065-201"},{section:"section-2"}
      ]
  }
]

function NestedMapping() {
  return (
 
    <div className='container'>

<div className="cards">
      <div className="card card-one">
      {Users.map((user)=>{
        const {name,university} = user;
        return(
          <div>
              <h2 className="card-title">Name: {name} </h2>
              <p className="description">University: {university} </p>
          </div>
          
        )
        {user.studentInfo.map((info)=>(
          <div>
              <h2 className="card-title">Name: {info.name} </h2>
              <p className="description">University: {info.university} </p>
          </div>
        ))}
      })}
       
          
       
       </div>
      </div>
    </div>

         
     

  )
}

export default NestedMapping
